/-- Axiom 3.3(b) (pair).  Note: in some applications one may have to cast {a,b}
    to Set. -/
theorem pair_eq (a b : Object) : ({ a, b } : Set) = { a } ∪ { b } := by rfl

/-- Example 3.1.10 -/
theorem pair_union_pair (a b c : Object) : ({ a, b } : Set) ∪ { b, c } = { a, b, c } := by ext;
  simp only [mem_union, mem_pair, mem_triple]; tauto

/-- Axiom 3.8 (Axiom of infinity) -/
def nat_equiv : ℕ ≃ Nat :=
  SetTheory.nat_equiv

/-- Example 3.1.31 -/
example : ({ 3, 5, 9 } : Set).replace (P := fun _ y ↦ y = 1) (by aesop) = { 1 } := by ext;
  simp only [replacement_axiom]; aesop
